import Links from "./links";
import { LinkWrapper, LinkMobile, LinkDesktop } from "./styles";
const SocialMediaLinks = () => (
	<LinkWrapper>
		<LinkMobile>
			<Links />
		</LinkMobile>
		<NavLinkDesktop>
			<Links />
		</NavLinkDesktop>
	</LinkWrapper>
);
export default SocialMediaLinks;
